class Solution:
    def minDeletions(self, s: str) -> int:
        res = 0
        dic = {}
        '''
        use dict to get frequencies of every character
        '''
        for i in range(len(s)):
            v = dic.setdefault(s[i], 0)
            dic[s[i]] = v + 1
        '''
        get the values entry from dict, convert it to List, and reverse it 
        '''
        frequencies = list(dic.values())
        frequencies.sort(reverse=True)
        '''
        for loop check the List, if i index is greater than i-1 index, minus the i index element, and plus the deletions
        '''
        for i in range(1, len(frequencies)):
            while frequencies[i] >= frequencies[i-1] and frequencies[i] > 0:
                frequencies[i] -= 1
                res += 1
        return res

if __name__ == '__main__':
    s = Solution()
    input = ""
    print(s.minDeletions(input))